    false,nt"url": null,nt"notes": "NODC Accession 0117696 includes Surface
    underway, chemical, meteorological and physical data collected from AURORA AUSTRALIS
    in the Indian Ocean, South Pacific Ocean and Tasman Sea from 2013-01-13 to 2013-03-14
    and retrieved during cruise 09AR20130113 and 09AR20130228. These data include AIR-SEA
    DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE,
    Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure
    (or fugacity) of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE, WIND
    DIRECTION and WIND SPEED. The instruments used to collect these data include Carbon
    dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous carbon
    dioxide (CO2) measurement and thermosalinographs. These data were collected by Bronte
    Tilbrook of Commonwealth Scientific and Industrial Research Organization as part
    of the VOS_Aurora_Australis_AA_2013_013-027 and VOS_Aurora_Australis_AA_2013_058-074
    data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
    UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
    from 14 countries have been outfitting research ships and commercial vessels with
    automated CO2 sampling equipment to analyze the carbon exchange between the ocean
